    [],nt"num_tags": 0,nt"name": "dissolved-inorganic-carbon-temperature-salinity-and-other-variables-collected-from-discrete-sama718d",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0112356 includes chemical,
    discrete sample, physical and profile data collected from MIRAI in the North Pacific
    Ocean and Philippine Sea from 2002-11-13 to 2002-12-16 and retrieved during cruise
    MR02-K06 Leg 1 and PACIFICA_49NZ20021113. These data include DISSOLVED INORGANIC
    CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, SALINITY, SIGMA-T and WATER TEMPERATURE.
    The instruments used to collect these data include CTD, Coulometer for DIC measurement
    and bottle. These data were collected by Eiji Yamashita and Kunio Yoneyama of Japan
    Agency for Marine-Earth Science and Technology (Jamstec) and Masao Ishii of Meteorological
    Research Institute; Geochemical Research Department as part of the PACIFICA_49NZ20021113
    data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
    project for the data synthesis of ocean interior carbon and its related parameters
    in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
    of Carbon and Climate (S-CC) supported the project.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
